import React, {useState} from 'react';
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';
import {Grid} from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const Skills = () => {
    return (
        <Grid container
        direction="row"
        justify="flex-start"
        alignItems="center">

        <Grid item xs={12}>
            <Typography
            display="block"
            justifyContent="center"
            align="center"
            variant="h4"
            style={{opacity:'100%', fontWeight:'bold', fontSize:'40px', marginBottom:'0', color:'white'}}>
                Skills
            </Typography>
        </Grid>

        <Grid item xs={4}>
            <div style={{backgroundColor:'black', border:'2px solid #cdffdb', borderRadius:'50%', height:'100px', width:'100px'}}>
                Skill
            </div>
        </Grid>

        </Grid>
    )
}

export default Skills;
